import {
  SignedIn,
  SignedOut,
  SignIn,
  UserButton
} from "@clerk/clerk-react";

function App() {
  return (
    <div style={{ padding: "40px", fontSize: "20px" }}>
      <SignedOut>
        <SignIn routing="path" path="/sign-in" />
      </SignedOut>

      <SignedIn>
        <h1>You're signed in!</h1>
        <UserButton />
      </SignedIn>
    </div>
  );
}

export default App;
